const uint16_t *get_edgetypes(int32_t dimx,int32_t dimy){
    static const uint16_t _etpos[]={0,16,80,336,400,912,5008,5264,9360};
    if((dimx==2&&dimy==2)||dimx<2||dimx>4||dimy<2||dimy>4)return nullptr;
    return _etlist+(_etpos[3*(dimx-2)+(dimy-2)]-16);
}


uint32_t flipx(uint32_t b,int dx,int dy){
    if(dx==3)
        return (b&0x49249249)<<2|b&0x92492492|b>>2&0x49249249;
    b=(b&0x55555555)<<1|b>>1&0x55555555;
    if(dx==2)return b;
    return (b&0x33333333)<<2|b>>2&0x33333333;
}
uint32_t flipy(uint32_t b,int dx,int dy){
    uint32_t lowx=(1<<dx)-1;
    if(dy==4){
        uint32_t low3x=lowx<<dx|lowx;
        uint32_t low5x=lowx<<2*dx|lowx;
        b=(b&low5x)<<dx|b>>dx&low5x;
        return (b&low3x)<<dx*2|b>>dx*2&low3x;
    }
    if(dy==3){
        return (b&lowx)<<dx*2|b&(lowx<<dx)|b>>dx*2&lowx;
    }
    if(dy==2){
        return (b&lowx)<<dx|b>>dx&lowx;
    }
}
uint32_t bitshuffle(uint32_t b,int d){
    //shuffle low d bits of b
    int buf[32];
    if(d>32)d=32;
    for(int i=0;i<d;++i){
        buf[i]=(b&1)!=0;
        b>>=1;
    }

    for(int i=d;i>0;){
        int chpos=random64()%i;
        --i;
        b<<=1;
        b|=buf[chpos];
        buf[chpos]=buf[i];
    }
    return b;
}

bool MustGuess(int32_t _width,int32_t _height,int8_t *_board,int32_t initx,int32_t inity){
#define Onboard(x,y) _board[(y)*_width+(x)]
    int32_t change_tries=4;
    do{
        bool changed=false;
        for(int dimx=MIN_PATCH_DIM;dimx<=4;++dimx)for(int dimy=MIN_PATCH_DIM;dimy<=4;++dimy){
            const uint16_t *etlist=get_edgetypes(dimx,dimy);
            if(!etlist)continue;
            int ex=-2;
            for(int sx=0;sx<=_width-dimx;++sx){
                //make initial binary
                uint32_t bmat=0;
                for(int iy=0;iy<dimy;++iy)for(int ix=0;ix<dimx;++ix){
                    bmat<<=1;
                    bmat|=uint32_t(Onboard(sx+ix,iy)==MS_FLAG);
                }

                int sy=0,ey=-2;
                do{
                    //Note, adjusting patch should not contain the initially opened block [initx,inity]
                    if(!(sx<=initx&&initx<sx+dimx&&sy<=inity&&inity<sy+dimy)){
                        uint32_t matpatch=bmat;
                        if(ex<0)matpatch=flipx(matpatch,dimx,dimy);
                        if(ey<0)matpatch=flipy(matpatch,dimx,dimy);
                        uint32_t testbit=1<<std::abs(ex)+std::abs(ey)*3;
                        bool mustguess=etlist[matpatch]&testbit;
                        if(mustguess){
                            if(!ADJUST_BOARD)return true;
                            //adjust here...
                            int32_t tries=128;
                            uint32_t changepatch=0,matbit=1<<dimx*dimy;
                            do{
                                changepatch=bitshuffle(matpatch,dimx*dimy);
                                if(!(etlist[changepatch]&testbit)){
                                    mustguess=false;
                                    break;
                                }
                            } while(--tries);
                            if(mustguess)
                                return true;

                            bmat=matpatch=changepatch;
                            if(ex<0)bmat=flipx(bmat,dimx,dimy);
                            if(ey<0)bmat=flipy(bmat,dimx,dimy);
                            for(int iy=0;iy<dimy;++iy)for(int ix=0;ix<dimx;++ix){
                                matbit>>=1;
                                Onboard(sx+ix,sy+iy)=(bmat&matbit)?MS_FLAG:MS_UNINITIALIZED;
                            }
                            changed=true;
                        }
                    }

                    if(sy==_height-dimy)break;
                    //next
                    for(int ix=0;ix<dimx;++ix){
                        bmat<<=1;
                        bmat|=uint32_t(Onboard(sx+ix,sy+dimy)==MS_FLAG);
                    }
                    bmat&=(uint32_t(1)<<dimx*dimy)-1;
                    ey+=(ey||sy+2==_height-dimy);
                    ++sy;
                } while(1);
                ex+=(ex||sx+2==_width-dimx);
            }
        }

        if(!changed)
            return false;
        if(!(--change_tries))
            return true;
    } while(1);
}
